    "rek_formatted_abstract": "Ischemia-reperfusion (I/R)-related disorders, such as stroke, myocardial infarction, and peripheral vascular disease, are among the most frequent causes of disease and death. Tissue injury or death may result from the initial ischemic insult, primarily determined by the magnitude and duration of the interruption in blood supply and then by the subsequent reperfusion-induced damage. Various <em>in vitro</em> and <em>in vivo </em>models are currently available to study I/R mechanism in the brain and other tissues. However, thus far, no <em>in ovo</em> I/R model has been reported for understanding the I/R mechanisms and for faster drug screening. Here, we developed an <em>in ovo</em> Hook model of I/R by occluding and releasing the right vitelline artery of a chick embryo at 72 h of development. To validate the model and elucidate various underlying survival and death mechanisms, we employed imaging (Doppler blood flow imaging), biochemical, and blotting techniques and evaluated the cell death mechanism: autophagy and inflammation caused by I/R. In conclusion, the present model is useful in parallel with established <em>in vitro</em> and <em>in vivo</em> I/R models to understand the mechanisms of I/R development and its treatment.",
